I found a workaround this problem. The workaround is to add selectionListener to the EditorPart and then remove it:

    INullSelectionListener selectionListener = new INullSelectionListener() {

      public void selectionChanged(IWorkbenchPart part, ISelection selection) {
      }
    };
    getSite().getPage().addSelectionListener(VesnikArchiveEditor.ID, selectionListener);
    getSite().getPage().removeSelectionListener(VesnikArchiveEditor.ID, selectionListener);

Maybe there is a better way...

To me this looks like a bug in the part tracker.  for example:
    public PagePartSelectionTracker(IWorkbenchPage page, String partId) {
        super(partId);
        setPage(page);
        page.addPartListener(this);
        IViewPart part = page.findView(partId);
        if (part != null) {
            setPart(part, false);
        }
    }

That won't work on an editor.  The reason it can work later is:
    public void partOpened(IWorkbenchPart part) {
        if (getPartId(part).equals(getPartId())) {
            setPart(part, true);
        }
    }

