The problem occurs when you try and delete a breakpoint, but one of the processes is not suspended.

To repeat:

1. Start debugging 3 processes.

2. Set a breakpoint on the 'rank += 1;' line.

3. Continue all processes. Process 0 should stay running (blocked in MPI_Finalize()), the other processes should hit the breakpoint.

4. Delete the breakpoint.

You should see the error at this point.

#include <mpi.h>
#include <stdio.h>

int
main(int argc, char *argv[])
{
                int rank;

        MPI_Init(&argc, &argv);
        MPI_Comm_rank(MPI_COMM_WORLD, &rank);
        printf("hi from %d\n", rank);

        if (rank > 0) {
                rank += 1;
                printf("in here\n");
                rank *=2;
        } else {
                rank += 3;
                printf("not in here\n");
                rank *= 4;
        }

        MPI_Finalize();
        return 0;
}

The help-page describes Wizards quite well: 
http://help.eclipse.org/help32/index.jsp?topic=/org.eclipse.platform.doc.isv/guide/dialogs.htm

There is also an (old) article that helps a lot: 
http://www.eclipse.org/articles/Article-JFace%20Wizards/wizardArticle.html

And there is a new article on progress-monitors: 
http://www.eclipse.org/articles/Article-Progress-Monitors/article.html

But -- the issue of "how to use a prog-mon from within a wizard" has fallen between the stools -- none of those resources covers the issue at all. 

Some points to include -- I am sure I am missing something and/or have misstated something -- which of course only emphasizes my point in filing this bug: 

0) to make use of the prog-mon built into your wizard, if you are using the jface Wizard, you must call (I think it must be in the method addPages()): 
<code>setNeedsProgressMonitor(true);</code> 

1) to have that built-in progress-monitor actually appear, you must define an implementation of IRunnableWithProgress and then call (in performFinish() or wherever you need to use the prog-mon) like this -- note that in order to get the prog-mon actually to update (show its blue bar) you must set fork = true: 
<code> 
try {
	getContainer().run(true, true, new MyRunnableWithProgress() {...});

} catch (InvocationTargetException invTargExn) {
	// TODO invocation-target exn ... whatever that means? 
	invTargExn.printStackTrace();

} catch (InterruptedException intExn) {
	// TODO handle cancelation 
} 
</code> 

2) and since fork==true, if your IRunnableWithProgress will, even via listeners, cause any GUI updates, you must place any such code within the usual asyncExec, like this: 
<code>
Display.getDefault().asyncExec(new Runnable() {
	public void run() { 
		updateMyGUI();
	}
});
</code> 

3) and one item I still do not know to make work, is how to get the "Cancel" button on the wizard, or any other control, actually to allow the user to cancel, even when the cancel is set to true (as above).

